import Link from 'next/link';

const linkStyle = {
    marginRight: 15
}

const Nav = () => (
    <div>
        <Link href="/">
            <a style={linkStyle}>Home</a>
        </Link>
        <Link href="/info">
            <a style={linkStyle}>Info</a>
        </Link>
    </div>
)

export default Nav;
